const addStructure = (arr) => {
  const partialStructure = [];
  const dataTaskStatus = [];
  arr.forEach((obj) => {
    if (obj.priority === 1) {
      return dataTaskPriority.push({
        ...obj,
        priorityText: "Low",
        priorityColor: "colorLow",
      });
    } else if (obj.priority === 2) {
      return dataTaskPriority.push({
        ...obj,
        priorityText: "Medium",
        priorityColor: "colorMedium",
      });
    } else if (obj.priority === 3) {
      dataTaskPriority.push({
        ...obj,
        priorityText: "High",
        priorityColor: "colorHigh",
      });
    }
  });
  dataTaskPriority.forEach((obj) => {
    if (obj.status === 1) {
      return dataTaskStatus.push({
        ...obj,
        statusText: "Done",
        statusProgress: 69.115,
      });
    } else if (obj.status === 2) {
      return dataTaskStatus.push({
        ...obj,
        statusText: "In process",
        statusProgress: 34.5575,
      });
    } else if (obj.status === 3) {
      return dataTaskStatus.push({
        ...obj,
        statusText: "To do",
        statusProgress: 0,
      });
    }
  });
  return dataTaskStatus;
};

export default addStructure;
